    Paypal_payment_not_completed_explained: "Posibles razones por las cuales el pago usando PayPal no pudo ser completado:<br><b>echeck</b>: El pago esta pendiente debido a que fue hecho mediante un eCheck el cual aun no ha sido cobrado.<br><b>internacional</b>: El pago esta pendiente debido a que el vendedor no tiene una cuenta en un banco de USA no teniendo un mecanismo para el retiro. El Vendedor debe aceptar o denegar manualmente este pago.<br><b>multi-currency</b>: El Vendedor no tiene saldo en la divisa enviada. El Vendedor debe manualemente aceptar o denegar este pago.<br><b>unilateral</b>: El pago esta pendiente porque fue hecho a una direccion de correo electronico la cual no esta registrara o confirmada aun.<br><b>actualizar</b>: El pago esta pendiente debido a que fue realizado a travez de una tarjeta de credito y el Vendedor debe actualizar su cuenta al grado Business o Premier para poder recibir los fondos. <br><b>verificar</b>: El pago esta pendiente debido a que el Vendedor no ha sido verificado aun. El Vendedor debe verificar su cuenta antes de poder aceptar este pago.<br><b>otros</b>: El pago es pendiente debido a otras razones que no estan listadas en este texto. Para mas informacion, contacte al servicio al cliente de PayPal.<br><b>Denegado</b>: El Vendedor se rehusa a aceptar este pago."
